import React from 'react';

import {NavLink} from 'react-router-dom'

const enigmaContainer = () => {
    return (
        <div>
            Enigmes
            <NavLink className="card" to="/">
                <div className="card-title">
                    <h2>
                        Au Pied du mur
                    </h2>
                </div>
            </NavLink>
        </div>
    );
};

export default enigmaContainer;
